import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import img1 from "./Javaimg/1.jpg";
function Java() {
  return (
    <div>
      <Container>
        <Row>
          <Col className="pycol1" lg={3}>
            <img src={img1} alt="" className="imi1" />
            <img src={img2} alt="" className="imi2" />
            <img src={img3} alt="" className="imi3" />
            <img src={img4} alt="" className="imi4" />
            <img src={img5} alt="" className="imi5" />
            <img src={img6} alt="" className="imi6" />
            <img src={img7} alt="" className="imi7" />
            <img src={img8} alt="" className="imi8" />
            <img src={img9} alt="" className="imi9" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Java;
